import axios from "axios";
import Card from "./card"
function Cards(){
    const [card,setCard]=useState([]);
    useEffect(()=>{
        axios.get("http://localhost:5003/inventory")
        .then((response)=>{
          setCard(response.data);
        })
        .catch((error)=>{
          console.log(error);
        })
      },[]);
    return(
    <div>
    <Home />
    <div className="card-list">
            {card.map((card) => (
                <Card
                    key='1'
                    id='1'
                    title="hi"
                    desc="hi"
                    price="hi"
                />
            ))}
        </div>
    </div>

    )
}
export default Cards;
